sys_variable_value.value:
(function execute(inputs, outputs) {
	var endpoint = inputs.url.slice(inputs.url.indexOf('?'));
    try {
    	var r = new sn_ws.RESTMessageV2('x_759224_magic_c_0.ScryFall API', 'Card GET');
    	r.setStringParameterNoEscape('query', endpoint);
    	var response = r.execute();
    	var httpStatus = response.getStatusCode();
		var parsedResponse = JSON.parse(response.getBody());
		if (inputs.foil.toString() == "foil") {
			outputs.price = parsedResponse.data[0].prices.usd_foil;
		} else if (inputs.foil.toString() == "etched") {
    		outputs.price = parsedResponse.data[0].prices.usd_etched;
  		}else{
  			outputs.price = parsedResponse.data[0].prices.usd;
    	}
    } catch (ex) {
    	gs.info("Scryfall API - " + ex.toString());
  	}

})(inputs, outputs);

